import { type } from "os";
import Container from "react-bootstrap/Container";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import "bootstrap/dist/css/bootstrap.min.css";
import React from "react";
import {
  MDBContainer,
  MDBCol,
  MDBRow,
  MDBBtn,
  MDBIcon,
  MDBInput,
  MDBCheckbox,
} from "mdb-react-ui-kit";

export interface iShema {
  name: "dark1" | "dark2" | "light" | "def";
}
type tMenu = {
  name: string;
  linkComp: string;
};

const listMenu: tMenu[] = [
  { name: "/MyApp", linkComp: "Home" },
  { name: "/Page2", linkComp: "Features" },
  { name: "/Login", linkComp: "Login" },
];

const Menu = () => {
  return listMenu.map((item) => {
    return <Nav.Link href={item.name}>{item.linkComp}</Nav.Link>;
  });
};

function ColorSchemesExample(props: iShema) {
  const testName: string = "Home";

  const project = () => {
    switch (props.name) {
      case "dark1":
        return (
          <Navbar bg="dark" data-bs-theme="dark">
            <Container>
              <Navbar.Brand href="#home">Navbar</Navbar.Brand>
              <Nav className="me-auto">
                {Menu()}
                {/* <Nav.Link href="#home">Home</Nav.Link>
                <Nav.Link href="#features">Features</Nav.Link>
                <Nav.Link href="#pricing">Pricing</Nav.Link> */}
              </Nav>
            </Container>
          </Navbar>
        );
      case "dark2":
        return (
          <Navbar bg="primary" data-bs-theme="dark">
            <Container>
              <Navbar.Brand href="#home">Navbar</Navbar.Brand>
              <Nav className="me-auto">
                {Menu()}
                {/* <Nav.Link href="#home">Home</Nav.Link>
                <Nav.Link href="#features">Features</Nav.Link>
                <Nav.Link href="#pricing">Pricing</Nav.Link> */}
              </Nav>

            </Container>
          </Navbar>
        );
      case "light":
        return (
          <Navbar bg="light" data-bs-theme="light">
            <Container>
              <Navbar.Brand href="#home">Navbar</Navbar.Brand>
              <Nav className="me-auto">
                {Menu()}
                {/* <Nav.Link href="#home">Home</Nav.Link>
                <Nav.Link href="#features">Features</Nav.Link>
                <Nav.Link href="#pricing">Pricing</Nav.Link> */}
              </Nav>
            </Container>
          </Navbar>
        );
      default:
        return <h1>No project match</h1>;
    }
  };
  return (
    <>
      <div>
        <MDBBtn floating size="sm" tag="a" className="me-2">
          <MDBIcon fab icon="facebook-f" />
        </MDBBtn>

        <MDBBtn floating size="sm" tag="a" className="me-2">
          <MDBIcon fab icon="twitter" />
        </MDBBtn>

        <MDBBtn floating size="sm" tag="a" className="me-2">
          <MDBIcon fab icon="linkedin-in" />
        </MDBBtn>
      </div>
      <div>{project()} </div>
    </>
  );
}

export default ColorSchemesExample;
